import { Container, Typography } from "@mui/material";
import React from "react";

function Patners() {
  return (
    <Container
      sx={{
        width: "100%",
        height: "280px",
        backgroundColor: "#d6e7fa",
        marginTop: 15,
        borderRadius: "70px",
      }}
    >
      <Typography
        sx={{
          fontFamily:"Manrope, sans-serif !important",
          textAlign: "center",
          fontSize: "2.3rem",
          fontWeight: "900",
          color: "black",
          lineHeight: 1.2,
        }}
      >
        Our Partners
      </Typography>
    </Container>
  );
}

export default Patners;
